description:
Canada
Avontuur / Familie
96 minuten

geregisseerd door Robert Vince
met Richard Riehle, Kaitlyn Maher en de stem van Zachary Gordon

Als de Kerstman en zijn nieuwe beste vriend Paws, ontdekken dat de jongens en de meisjes van de wereld de geest van Kerstmis hebben verloren, ondernemen ze een trip naar New York. Maar nadat de Kerstman zijn geheugen verliest, is het aan Paws, het trouwe weesmeisje Quinn, haar nieuwe vriend Will en een wonderbaarlijke groep van magische, pratende honden, om de Kerstman uit de nood te helpen en de wereld te laten zien waar Kerstmis eigenlijk echt over gaat.

